import "./Home.css";
import { Link } from "react-router-dom";
import Header from '../../components/Header'

function Home() {
    return(
        <>
            <h1>OOIE</h1>
            <div>
                <Link to="/bancoDados"><p>Capitalismo</p></Link>
            </div>
            
        </>
    );
}

export default Home;
